import React from 'react';

const NumericalQuestions = () => {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Numerical Aptitude</h1>
      <div>
        <h2 className="text-xl font-semibold">Question 1</h2>
        <p>What is 15% of 200?</p>
        <p className="mt-2 font-bold">Answer:</p>
        <p>The answer is 30.</p>
      </div>
      <div className="mt-4">
        <h2 className="text-xl font-semibold">Question 2</h2>
        <p>Solve for x: 2x + 3 = 11</p>
        <p className="mt-2 font-bold">Answer:</p>
        <p>x = 4.</p>
      </div>
      {/* Add more questions and answers as needed */}
    </div>
  );
};

export default NumericalQuestions;
